&lt;p&gt;
Silicate, c&apos;est une chaine Youtube qui parle chaque mois d&apos;artistes, de dessinateurs, de vidéastes mais surtout de musiciens... Alors on s&apos;est dit pourquoi pas faire une compile de tous les foufous borderline qu&apos;on a croisé dans cette première saison ? Merci à Ouïedire de nous donner l&apos;opportunité de vous faire connaître ceux qu&apos;on ne voit pas sur les plateaux télé, ceux qu&apos;on n&apos;entend pas à la radio, ceux qui ne trainent jamais dans les grands médias. Les gens du fond de la classe qui jouent à 4h du mat&apos; dans des caves, de Bruxelles à Paris, de Londres à Hong-Kong. Toujours en marge. Parce que, en vérité, la marge c&apos;est ce qui tient la page ! 
&lt;br /&gt;
Pour mater les épisodes de Silicate c&apos;est &lt;a href=&quot;https://bit.ly/2wXlwAd&quot;&gt;ici&lt;/a&gt;

&lt;/p&gt;

